var lib = new x_terrd_snow_cicd.CICDLibrary();
if (lib.getByParam('pulls?state=open').length > 0) {
    current.work_notes = "Pull request is open. Please go to github to review the code and complete the pull request.";

    current.state = "In Code Review";
} else {
    current.work_notes = "No active pull request. Will push the code to Qa.";

	lib.handleDeployment('loadUpdateSet');
    
}

