activity.result = getActivityResult();
//Find if any Cabinet has sql_nodes Or ap_nodes
function getActivityResult()
{
	var util = new x_terrd_snow_cicd.CiCdAtfLibrary();
	var activity_result = util.getTestActivityStatus();
	workflow.info("Get activity.result:"+activity_result);
	
	if(activity_result == "Failed")
		current.state = "Test Failed";
	else if(activity_result == "Successful")
		current.state = "Test Passed";
	
	return activity_result;
}

