if (!workflow.scratchpad.triggered) {

	workflow.scratchpad.atfScheduleStartedAt = new GlideDateTime().getValue();
	
    var gr = new GlideRecord('sys_atf_schedule');
    gr.addEncodedQuery('active!=false');
    //gr.setLimit(100);
    gr.query();

    gs.info('total ' + gr.getRowCount());

    while (gr.next()) {
        new global.ScheduledTestProcessor().executeScheduledSuites(gr.sys_id);

        workflow.scratchpad.atfScheduleList.push(gr.getValue('sys_id'));

        current.work_notes = "Started " + gr.name;
    }


    workflow.scratchpad.triggered = true;
}

